INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 0.0, 1, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24015, 4, 10021, 0.0, 0.0, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 4.0, 2, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24016, 4, 10021, 0.0, 0.0, 1, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 0.0, 3, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24017, 4, 10021, 0.0, 0.0, 4, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 5.2, 4, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24018, 1, 10021, 0.0, 0.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 4.2, 5, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24019, 5, 10021, 0.0, 0.0, 6, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 0.0, 6, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24020, 2, 10021, 0.0, 0.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 6.4, 7, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24021, 1, 10021, 0.0, 0.0, 6, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 0.0, 8, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24022, 2, 10021, 0.0, 0.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 10.08, 9, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24023, 6, 10021, 0.0, 0.0, 3, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 5.0, 10, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24024, 1, 10021, 0.0, 0.0, 2, "2019/07/31 12:00:00");
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (24, 0.0, 11, 110501, "カオリ（サマー）", "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24025, 2, 10021, 0.0, 0.0, 2, "2019/07/31 12:00:00");
